import React from "react";
import { Bubble } from "react-chartjs-2";

const data = {
  datasets: [
    {
      label: "Albums",
      backgroundColor: "#1DB954",
      borderColor: "#1DB954",
      data: [
        { x: 2000, y: 60, r: 20 },
        { x: 2005, y: 70, r: 30 },
        { x: 2010, y: 80, r: 40 },
        { x: 2015, y: 90, r: 50 },
        { x: 2020, y: 100, r: 60 },
      ],
    },
  ],
};

const BubbleChart = () => {
  return (
    <div>
      <h2>Bubble Chart</h2>
      <Bubble
        data={data}
        options={{
          scales: {
            xAxes: [
              {
                ticks: {
                  min: 2000,
                  max: 2020,
                  stepSize: 5,
                },
              },
            ],
            yAxes: [
              {
                ticks: {
                  min: 0,
                  max: 120,
                  stepSize: 20,
                },
              },
            ],
          },
        }}
      />
    </div>
  );
};

export default BubbleChart;
